description:
प्लानिङ ब्वाइज युनाइटेडले काँक्रेविहार क्लबलाई पराजित गर्दै एन्फा राष्ट्रिय लिग फुटबल प्रतियोगितामा जित हासिल &amp;nbsp;गरेको छ ।
&amp;nbsp;
सातदोबाटोस्थित एन्फा मुख्यालय मैदानमा आज भएको खेलमा प्लानिङ ब्वाइज युनाइटेड काँक्रेविहार क्लबलाई ३&amp;ndash;

जाडो मौसममा चिसो हावा चल्न थालेपछि एक कचौरा तातो सुपले शरीरलाई भित्रबाट न्यानो राख्नुका साथै मनलाई पनि शान्त बनाउँछ ।

टमाटरको सुप हरेक घरपरिवारमा मनपर्ने हुन्छ । यो जति स्वादिष्ट छ त्यति नै स्वस्थकर पनि छ ।&amp;nbsp;&amp;nbsp;

जाडोमा टमाटरको सुप पि
